import ProfileForm from './ProfileForm';
import classes from './UserProfile.module.css';

const UserProfile = () => {
  return (
    <section className={classes.profile}>
      <header className='border-bottom'>
      <h1>My account</h1>
      <h2>Welcome Amit</h2>
      <button type="button" class="amit btn btn-outline-info p-2 bd-highlight" data-mdb-ripple-color="dark" style={{borderColor:'#008190', color:'333333'}}>Logout</button>
      {/* <ProfileForm /> */}
      </header>
    </section>
  );
};

export default UserProfile;
